import React from "react";
import "./Form.css";

const Form = () => {
    // {
    //     "id": 1,
    //     "title": "Kit Notebook Acer Aspire 3 + Mochila Green, A315-41-R790, AMD Ryzen 3 2200U Dual Core",
    //     "price": 1799,
    //     "url": "",
    //     "imageUrl": "https://m.media-amazon.com/images/I/61o0lt6Sh6L._AC_SL1000_.jpg"
    // }
    
    return (
        <div>
            <h1>Promo Show</h1>
            <h2>Nova Promoção</h2>
            <form>
                <div className="promotion-form_group">
                    <label htmlFor="title">Título</label>
                    <input id="title" name="title" type="text"/>
                </div>
                <div className="promotion-form_group">
                    <label htmlFor="url">Link</label>
                    <input id="url" name="url" type="text"/>
                </div>
                <div className="promotion-form_group">
                    <label htmlFor="imageURL">Imagem (Url)</label>
                    <input id="imageURL" name="imageURL" type="text"/>
                </div>
                <div className="promotion-form_group">
                    <label htmlFor="price">Prelo</label>
                    <input id="price" name="price" type="number"/>
                </div>
            </form>
        </div>
    )
};

export default Form;
